    <style>
      * {
        margin: 0;
        padding: 0;
      }
      html {
        height: 100%;
      }
      body {
        background: url('binding_dark.png');
        cursor: none;
        height: 100%;
      }
      input {
        width: 1px;
        height: 1px;
        border: 0;
        background: none;
      }
      .clear {
        clear: both;
      }
      @-webkit-keyframes blinker {
        from { opacity: 1; }
        to { opacity: 0; }
      }
      @keyframes blinker {
        from { opacity: 1; }
        to { opacity: 0; }
      }
      p {
        font-family: Consolas, monospace;
        font-size: 50%;
        white-space: nowrap;
        overflow: hidden;
        float: left;
        position: relative;
        text-align: left;
      }
      div {
        outline: 0;
      }
      .wrapper, .v-wrapper {
        position: absolute;
        top: 45%;
        right: 50%;
        font-family: 'Quantico', sans-serif;
        font-size: 40px;
        color: #EEE;
        text-align: center;
      }
      .v-wrapper {
        width: 100%;
        top: 5%;
        transform: scale(0);
        opacity: 0;
        transition: transform 500ms, opacity 500ms;
        right: 0;
      }
      .top40 {
        top: 40%;
      }
      .child div {
        font-family: 'Quantico', sans-serif;
        font-size: 40px;
        color: #EEE;
        z-index: 999;
      }
      h1 {
        font-family: 'Quantico', sans-serif;
        font-size: 40px;
        color: #EEE;
        text-align: center;
        text-decoration: blink;
        position: relative;
        right: -50%;
        margin-bottom: -20px;
      }
      .blink {
        -webkit-animation-name: blinker;
        -webkit-animation-iteration-count: infinite;
        -webkit-animation-timing-function: cubic-bezier(1, 0, 1);
        -webkit-animation-duration: 1s;
        animation-name: blinker;
        animation-iteration-count: infinite;
        animation-timing-function: cubic-bezier(1, 0, 1);
        animation-duration: 1s;
      }
      .cursor {
        opacity: 0;
      }
      .cursor, #zoera {
        position: relative;
        right: -50%;
        float: left;
      }
      video {
        position: relative;
      }
      .v-wrapper .cursor {
        font-size: 50%;
      }
      .float-l {
        float: left;
      }
      .v-wrapper > div.l {
        width: auto;
        margin-left: 60px;
      }
      .v-wrapper > div.l .cursor {
        right: 0;
      }
      p.typewrite {
        display: block;
        white-space: nowrap;
        overflow: hidden;
      }
      p.startTypewrite {
        width: 0;
      }
      .v-w {
        width: 759px;
        overflow: hidden;
        float: left;
        position: relative;
        right: -2%;
      }
      #p05, #p11, #p18, #p23 {
        margin-bottom: 16px;
      }
    </style>
</head>
